export const artc_how_do_we_measure = ["Percentage of adults participating in arts and cultural activities."];
export const artc_source_name = ["Engagement in culture, arts, heritage and sport by adults in Northern Ireland 2023/24."];
export const artc_source_url = ["https://www.communities-ni.gov.uk/publications/engagement-culture-arts-heritage-and-sport-adults-northern-ireland-202324"];
export const artc_further_information = ["Participation in arts and cultural activities is defined as the percentage of adults (aged 16+) who have done at least one of the following within the last 12 months; engaged in the arts, used the public library service, visited a museum or science centre or used PRONI services.\r\n\r\nIn 2019/20, the questions on visits to museums were revised and as a result figures for visits to museums in 2019/20 are not comparable with previous years. Although this is one element of the overall culture and arts engagement rate, the impact of the change is lessened in the culture and arts estimates as the majority of those who visit museums also engage in some other way with culture and arts.\r\n\r\nFollowing a move in 2020/21 from face-to-face interviewing to telephone interviewing to collect data, due to the coronavirus (COVID-19) pandemic, data collection for the Continuous Household Surveys 2021/22 to 2023/24 used a mix of telephone and face-to-face modes. \r\n\r\nResults from 2021/22 to 2023/24 are not directly comparable to previous years due to the significant changes to the survey in terms of methodology and content.\r\n\r\nWhile comparisons can be made between 2021/22 and 2023/24, it is important to note that engaging in arts/cultural activities in 2021/22 would have been impacted by closures due to COVID-19.\r\n\r\nMissing values are denoted by '..' when viewed in the portal and blanks when downloaded."];
export const artc_metadata = {dataset : "ARTC", table_code : "ARTCULEQ", years : "2007/08 - 2023/24", start_year : "2007/08", end_year : "2023/24", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/ARTCULEQ", name : "", id : "EQGRP", email : "analyticsdivision@communities-ni.gov.uk", subject : "Culture, Arts, Heritage and Sport", product : "Engagement in culture, arts, heritage and sport", title : "Arts and Cultural Activities", note : "[b]Arts and cultural activities[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nPercentage of adults participating in arts and cultural activities.\r\n\r\n[b]Source[/b]\r\n[url=https://www.communities-ni.gov.uk/publications/engagement-culture-arts-heritage-and-sport-adults-northern-ireland-202324]Engagement in culture, arts, heritage and sport by adults in Northern Ireland 2023/24.[/url]\r\n\r\n[b]Further information[/b]\r\nParticipation in arts and cultural activities is defined as the percentage of adults (aged 16+) who have done at least one of the following within the last 12 months; engaged in the arts, used the public library service, visited a museum or science centre or used PRONI services.\r\n\r\nIn 2019/20, the questions on visits to museums were revised and as a result figures for visits to museums in 2019/20 are not comparable with previous years. Although this is one element of the overall culture and arts engagement rate, the impact of the change is lessened in the culture and arts estimates as the majority of those who visit museums also engage in some other way with culture and arts.\r\n\r\nFollowing a move in 2020/21 from face-to-face interviewing to telephone interviewing to collect data, due to the coronavirus (COVID-19) pandemic, data collection for the Continuous Household Surveys 2021/22 to 2023/24 used a mix of telephone and face-to-face modes. \r\n\r\nResults from 2021/22 to 2023/24 are not directly comparable to previous years due to the significant changes to the survey in terms of methodology and content.\r\n\r\nWhile comparisons can be made between 2021/22 and 2023/24, it is important to note that engaging in arts/cultural activities in 2021/22 would have been impacted by closures due to COVID-19.\r\n\r\nMissing values are denoted by '..' when viewed in the portal and blanks when downloaded.\r\n\r\n[b]Section 75 category[/b]: Age\r\n[b]Variable used[/b]: Age\r\n[b]Breakdown available[/b]: 16-24; 25-34; 35-49; 50-64; 65-74; 75+\r\n\r\n[b]Section 75 category[/b]: Men and women generally\r\n[b]Variable used[/b]: Sex\r\n[b]Breakdown available[/b]: Male; Female\r\n\r\n[b]Section 75 category[/b]: Marital status\r\n[b]Variable used[/b]: Marital status \r\n[b]Breakdown available[/b]: Single (never married or never in a legally registered civil partnership); Married or in a legally registered civil partnership; Separated (but still legally married or still legally in a civil partnership); Divorced or formerly in a civil partnership which is now legally dissolved; Widowed or surviving member of a legally registered civil partnership\r\n\r\n[b]Section 75 category[/b]: Persons with a disability and persons without\r\n[b]Variable used[/b]: Disability\r\n[b]Breakdown available[/b]: Disabled; Not Disabled\r\n\r\n‘Disability’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities.\r\n\r\nData is not available for 2020/21 as the question was not asked.\r\n\r\n[b]Section 75 category[/b]: Religious belief\r\n[b]Variable used[/b]: Religion\r\n[b]Breakdown available[/b]: Catholic; Protestant and other Christian religions; Other/no religion\r\n\r\n[u]'Other/No religion' includes:[/u] those who stated a religion other than Catholic and Protestant, those who stated no religion, those who refused to answer the question, and those whose answer was missing.\r\n\r\n[b]Section 75 category[/b]: Sexual orientation\r\n[b]Breakdown available[/b]: These data are not collected by the survey\r\n\r\n[b]Section 75 category[/b]: Persons with dependants and persons without\r\n[b]Variable used[/b]: Dependants\r\n[b]Breakdown available[/b]: Has dependants; Does not have dependants\r\n\r\n[u]‘Dependants' includes[/u]: individuals who have responsibility for the care of: a child(ren); a person with a disability; and/or a dependant elderly person.\r\n\r\nData is available from 2010/11.\r\n\r\n[b]Section 75 category[/b]: Racial group\r\n[b]Breakdown available[/b]: These data are not available\r\n\r\nAnalysis cannot be carried out at this level without combining a number of annual datasets.\r\n\r\n[b]Section 75 category[/b]: Political opinion\r\n[b]Breakdown available[/b]: These data are not collected by the survey"};
