export const self_how_do_we_measure = ["Self-efficacy is defined as a person’s belief about their capabilities to exercise influence over events that affect their lives.\r\n\r\nThe tool for measuring self-efficacy is a simple statement-based survey tool. It takes the form of five simple statements to which the individual indicates to what extent they agree or disagree on a five-point Likert scale. Self-efficacy is then presented as an overall score, minimum 5 and maximum 25, taken from the summed total of the five statement questions. Self-efficacy scores of 70% or more of the total possible score (i.e. 18 to 25) are categorised as high self-efficacy; low self-efficacy is therefore anything under 70% of the total possible score (i.e. 5 to 17)."];
