export const resp_further_information = ["The source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\r\n\r\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\r\n\r\nThe Respect Index is produced from responses to 9 questions (known as the Everyday Discrimination Scale) included in the Northern Ireland Life & Times Survey.\r\n\r\nA Respect Index is a measure of the percentage of respondents reporting they feel respected.\r\n\r\nSome figures have been suppressed due to small sample sizes, missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed."];
export const resp_metadata = {dataset : "RESP", table_code : "RESPECTEQ", years : "2016 - 2023", start_year : "2016", end_year : "2023", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/RESPECTEQ", name : "PfG Analytics, The Executive Office", id : "EQGRP", email : "pfganalytics@executiveoffice-ni.gov.uk", subject : "Surveys", product : "Life and Times Survey", title : "Respect", note : "[b]Respect[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nPercentage of the population aged 18+ who feel respected. (For this indicator, a higher figure is better).\r\n\r\n[b]Source[/b]\r\n[url=https://www.executiveoffice-ni.gov.uk/publications/respect-index-northern-ireland-measured-by-everyday-discrimination-scale-2016-2023]A Respect Index for Northern Ireland (as measured by the Everyday Discrimination Scale): 2016 – 2023 | The Executive Office.[/url]\r\n\r\n[b]Further information[/b]\r\nThe source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\r\n\r\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\r\n\r\nThe Respect Index is produced from responses to 9 questions (known as the Everyday Discrimination Scale) included in the Northern Ireland Life & Times Survey.\r\n\r\nA Respect Index is a measure of the percentage of respondents reporting they feel respected.\r\n\r\nSome figures have been suppressed due to small sample sizes, missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed.\r\n\r\n[b]Section 75 category[/b]: Age\r\n[b]Variable used[/b]: Age\r\n[b]Breakdown available[/b]: 18-24; 25-34; 35-49; 50-64; 65+\r\n\r\n[b]Section 75 category[/b]: Men and women generally\r\n[b]Variable used[/b]: Sex\r\n[b]Breakdown available[/b]: Female; Male\r\n\r\n[b]Section 75 category[/b]: Marital status\r\n[b]Variable used[/b]: Marital status\r\n[b]Breakdown available[/b]: Single; Married/Civil partnership; Separated; Divorced; Widowed\r\n\r\nThe definition of marital status in the Northern Ireland Life & Times survey does not include 'cohabiting' as a classification.\r\n\r\n[b]Section 75 category[/b]: Persons with a disability and persons without\r\n[b]Variable used[/b]: Disability\r\n[b]Breakdown available[/b]: Disabled; Not Disabled\r\n\r\n‘[u]Disability[/u]’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities.\r\n\r\n[b]Section 75 category[/b]: Religious belief\r\n[b]Variable used[/b]: Religion\r\n[b]Breakdown available[/b]: Catholic; Protestant; Other/no religion \r\n\r\n‘[u]Catholic[/u]’ includes the category 'Catholic'.\r\n‘[u]Protestant[/u]’ includes the categories: 'Church of Ireland/Anglican/Episcopal', 'Baptist', 'Methodist', 'Presbyterian', 'Free Presbyterian', 'Brethren', 'United Reform Church (URC)/Congregational', 'Pentecostal', 'Church of Scotland', 'Elim Pentecostal', 'Reformed Presbyterian', 'Non-subscribing Presbyterian', 'Salvation Army', 'Church of Nazarene', 'Other Protestant, specify'.\r\n‘[u]Other/no religion[/u]’ includes the categories: 'No religion', 'Jehovah's Witness', 'Church of Jesus Christ of Latter Day Saints (Mormon)', 'Other Christian, specify', 'Hindu', 'Jewish', 'Islam/Muslim', 'Sikh', 'Buddhist', 'Other (WRITE IN)', 'Don`t know', 'Not answered/Refused'.\r\n\r\n[b]Section 75 category[/b]: Sexual orientation\r\n[b]Variable used[/b]: Sexual orientation\r\n[b]Breakdown available[/b]: Straight or heterosexual; Gay, lesbian, bisexual or other sexual orientation\r\n\r\n[b]Section 75 category[/b]: Persons with dependants and persons without\r\n[b]Breakdown available[/b]: These data are not collected by the survey\r\n\r\n[b]Section 75 category[/b]: Racial group\r\n[b]Variable used[/b]: Ethnic Group\r\n[b]Breakdown available[/b]: White; Other\r\n\r\n‘[u]Other[/u]' includes: 'Irish Traveller'; 'Indian'; 'Pakistani'; 'Bangladeshi'; 'Chinese'; 'Any other Asian background'; 'Black African'; 'Black Caribbean'; 'Any other mixed/multiple ethnic background'; and 'Any other ethnic group'.\r\n\r\n[b]Section 75 category[/b]: Political opinion\r\n[b]Breakdown available[/b]: Unionist; Nationalist; Neither\r\n\r\nRespondents are asked - ‘Generally speaking, do you think of yourself as a unionist, a nationalist or neither’? and responses are coded as 'Unionist', 'Nationalist', 'Neither', 'Other' or 'Don`t know'.\r\n'[u]Neither[/u]' category includes 'Neither', 'Other', 'Don’t know' , 'Not answered/Refused' and, after 2020, 'Prefer not to say'."};
