export const sar3_further_information = ["From academic year 2013/14, ‘regulated enrolments’ at ‘level 3 or below’ are regarded as those on courses that are at and appear on the Register of Regulated Qualifications (RRQ), which contains qualifications on both the Qualifications and Credit Framework and the National Qualifications Framework or part of the Department’s Prescribed List of Approved Qualifications (PLAQ)/Access list).\r\n\r\n“Level” refers to the nationally recognised qualification level of the course.\r\n\r\nAchievements are final year full and partial achievements.\r\n\r\nTransfers are excluded from the analysis.\r\n\r\nWithdrawals are included where there is an achieved outcome.\r\n\r\nIn 2020/21, 2021/22 and 2022/23, where the Outcome code is ‘S’ (COVID affected - outcome deferred to next year), these enrolments are filtered out of all performance analysis, that is Students Enrolled in Final Year and Students Achieving Qualifications.\r\n\r\n Due to rounding the sum of numbers in each row or column may not match the total shown.\r\n\r\nPercentages are based on unrounded figures and are suppressed if a figure is less than 22.5. Percentages have been rounded to the nearest integer."];
export const sar3_metadata = {dataset : "sar3", table_code : "SARQL3FEEQ", years : "2019/20 - 2022/23", start_year : "2019/20", end_year : "2022/23", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/SARQL3FEEQ", name : "Department for the Economy", id : "EQGRP", email : "dfemail@economy-ni.gov.uk", subject : "Higher and Further Education and Training Statistics", product : "Further Education Statistics", title : "Students Achieving Regulated Qualifications at Level 3 in FE Colleges", note : "[b]Students Achieving Regulated Qualifications at Level 3 in FE Colleges[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nIndividual students are identified using student ID within each college and each academic year. Students can achieve a qualification in more than one course.\r\n\r\nOnly students enrolled in their final year on Regulated Level 3 courses are included in this analysis. Those in their final year, who have completed the course and subsequently achieved are regarded as “Students achieving qualifications”.\r\n\r\nTo prevent the identification of individuals, figures in the attached tables are rounded to the nearest 5, with 0, 1, 2 rounded to 0.\r\n\r\n[b]Source[/b]\r\nThe information presented in this table has been derived from Consolidated Data return (CDR) provided by FE Colleges. Each of the data returns are computerised data files consisting of individual records for each enrolment recorded by FE Colleges during each academic year. Figures are correct as of the 13th of October 2023.\r\n\r\n[b]Further information[/b]\r\nFrom academic year 2013/14, ‘regulated enrolments’ at ‘level 3 or below’ are regarded as those on courses that are at and appear on the Register of Regulated Qualifications (RRQ), which contains qualifications on both the Qualifications and Credit Framework and the National Qualifications Framework or part of the Department’s Prescribed List of Approved Qualifications (PLAQ)/Access list).\r\n\r\n“Level” refers to the nationally recognised qualification level of the course.\r\n\r\nAchievements are final year full and partial achievements.\r\n\r\nTransfers are excluded from the analysis.\r\n\r\nWithdrawals are included where there is an achieved outcome.\r\n\r\nIn 2020/21, 2021/22 and 2022/23, where the Outcome code is ‘S’ (COVID affected - outcome deferred to next year), these enrolments are filtered out of all performance analysis, that is Students Enrolled in Final Year and Students Achieving Qualifications.\r\n\r\n Due to rounding the sum of numbers in each row or column may not match the total shown.\r\n\r\nPercentages are based on unrounded figures and are suppressed if a figure is less than 22.5. Percentages have been rounded to the nearest integer.\r\n\r\n[b]Section 75 category[/b]: Age\r\n[b]Variable used[/b]: Age\r\n[b]Breakdown available[/b]: 19 and under; 20-24; 25+\r\n\r\nAge is calculated at 1st July prior to the start date of enrolment. Where a student has more than one achievement and therefore possibly more than one age calculated, (as the academic year August to July does not quite align with the age taken at 1st July) the youngest age is used in this analysis.\r\n\r\n[b]Section 75 category[/b]: Men and women generally\r\n[b]Variable used[/b]: Sex\r\n[b]Breakdown available[/b]: Female; Male \r\n\r\nThe student provides their sex at the time of enrolment.\r\n\r\n[b]Section 75 category[/b]: Marital status\r\n[b]Variable used[/b]: Marital status\r\n[b]Breakdown available[/b]: Single (never married or never in a legally registered civil partnership); Married or in a legally registered civil partnership; Divorced or formerly in a civil partnership which is now legally dissolved/Separated (but still legally married or still legally in a civil partnership); Widowed or surviving member of a legally registered civil partnership; Unknown\r\n\r\nMarital status is supplied by the student at the time of enrolment.\r\n\r\n[b]Section 75 category[/b]: Persons with a disability and persons without\r\n[b]Variable used[/b]: Disability\r\n[b]Breakdown available[/b]: Disabled; Not Disabled\r\n\r\nInformation on student disability is derived from individuals self-reporting a disability.\r\n\r\n[b]Section 75 category[/b]: Religious belief\r\n[b]Variable used[/b]: Religious belief\r\n[b]Breakdown available[/b]: Catholic; Protestant and other Christian religions; Other; No religion; Not stated\r\n\r\nReligious belief is self-reported by the student at the time of enrolment.\r\n\r\n[b]Section 75 category[/b]: Sexual orientation\r\n[b]Variable used[/b]: Sexual orientation\r\n[b]Breakdown available[/b]: Straight or heterosexual; Gay, lesbian, bisexual or other; Prefer not to say/not stated\r\n\r\nSexual orientation is supplied by the student at the time of enrolment.\r\n\r\n[b]Section 75 category[/b]: Persons with dependants and persons without\r\n[b]Variable used[/b]: Dependants\r\n[b]Breakdown available[/b]: Has dependants; Does not have dependants\r\n\r\n‘With dependants' includes: individuals who have responsibility for the care of: a child(ren); a person with a disability; and/or a dependant elderly person. Dependants is derived from 3 fields: \r\n\r\n1. Dependent Adult field - indicates whether the individual has indicated they have responsibility for one or more Dependent adults.\r\n2. Dependent Children field - indicates whether the individual has indicated they have responsibility for dependent children.\r\n3. Dependant person with a disability field - indicates whether the individual has indicated they have responsibility for one or more persons with a disability.\r\n\r\n[b]Section 75 category[/b]: Racial group\r\n[b]Variable used[/b]: Ethnic Group\r\n[b]Breakdown available[/b]: White; Other; Unknown\r\n\r\nDue to low numbers, students of any other ethnic group than white or unknown have been combined into ‘Other’.\r\n\r\nEthnicity is supplied by the student at the time of enrolment.\r\n\r\n[b]Section 75 category[/b]: Political opinion\r\n[b]Breakdown available[/b]: These data are not collected by the survey"};
